INSERT INTO `post` (`id`, `user_id`, `content`, `file`, `nameoffile`, `ctime`, `title_id`, `turnof_cmt`, `isedit`, `language_id`) VALUES
(1, 804260829616815200, 'First start by reading how use XMLHttpRequest.open() because theres a third optional parameter for specifying whether to make an asynchronous request, defaulting to true. This means you re making an asynchronous request and need to specify a callback function before you do the send(). Heres an example from the Mozilla Developer Network: His opening goal against Paris Saint-Germain on 14 February 2018 was his 100th for Madrid in the UEFA Champions League, the first time someone had reached that mark for a single club. Messi reached his century, all for Barcelona, exactly a month later against Chelsea.', NULL, NULL, '2018-04-03 21:55:35', 5, 1, 1, 7),
(2, 804260829616815200, 'It is one of the UEFA Champions League\'s best sub-plots. The two greatest forwards of the age have long since surpassed Raúl González\'s goals haul in the competition and by the end of the 2014/15 campaign Lionel Messi and Cristiano Ronaldo had 77 strikes each.UEFA.com has listed all of Messi and Ronaldo\'s UEFA Champions League goals since they first netted at this level – picking out some noteworthy stats amid the numbers. ', NULL, NULL, '2018-04-03 21:57:29', 1, 0, 1, 7),
(3, 804260829616815200, 'Then last season, however, Ronaldo became the first player to score 100 times in UEFA club competition, a milestone that Messi emulated on matchday three of the current campaign. The Real Madrid and former Manchester United star, though, leads 119–100 in terms of UEFA Champions League goals alone; and in all UEFA club competition action the scoreline is 122–103 in his favour.', NULL, NULL, '2018-04-03 21:53:35', 3, 1, 1, 7),
(4, 402629716513658300, 'i have some question about you\r\nfist....second.....Amazing solutions to avoid feeling nervous and embarrassed when speaking English\r\nAn easier way to speak English fluently\r\nHow to master spoken grammar without studying grammar rules\r\nSign-up for FREE and start now', NULL, NULL, '2018-04-03 08:49:48', 1, 0, 0, 7),
(5, 402629716513658300, 'I started to communicate and that was amazing!\r\nBeing a part of the marketing department at an international company means that you have to contact other people from different localizations and cooperate with them. We also have annual …', NULL, NULL, '2018-04-03 08:50:29', 5, 1, 0, 7),
(6, 184467440737095520, 'The U.S. president isnt prepared to negotiate with North Koreas Kim Jong Un, strategists argue Trump doesnt know a great deal about Korea — we know that he doesnt read very much, he watches a lot of television and his national security staff is sort of in chaos right now, Robert Kelly, associate professor at Pusan National University, told CNBC.', NULL, NULL, '2018-04-03 11:14:06', 4, 0, 0, 7),
(8, 660454276020380500, 'Marvel Comics is the common name and primary imprint of Marvel Worldwide Inc., formerly Marvel Publishing, Inc. and Marvel Comics Group, a publisher of American comic books and related media. Wikipedia', NULL, NULL, '2018-04-03 10:18:14', 4, 0, 0, 7),
(9, 660454276020380500, 'Mavels four managing partners have worked together for almost a quarter of a century. All are significant shareholders and all hold both regional sales and functional responsibilities. The managing partners lead a team of people based in Europe and North America. Included in the total, are 60 hydraulic, mechanical, electrical or civil engineers. These engineers, with extensive experience in hydroelectric power, work throughout the company in design, production, service, sales, R&D, purchasing and administration.', NULL, NULL, '2018-04-03 17:07:00', 5, 0, 0, 7),
(10, 804260829616815200, 'However, browser support is lacking at present. Chrome 27 (current at time of writing) supports this, but, see the outstanding bug for Mozilla https://bugzilla.mozilla.org/show_bug.cgi?id=596681 indicating it does not at present.Rất rất lâu rồi\n', NULL, NULL, '2018-04-04 09:55:40', 1, 0, 1, 7),
(11, 804260829616815200, 'Barack Hussein Obama Sr was a Kenyan senior governmental economist and the father of Barack Obama, the 44th President of the United States. He is a central figure of his son\'s memoir, Dreams from My Father (1995). Obama married in 1954 and had two children with his first wife, Kezia. He was selected for a special ...', NULL, NULL, '2018-04-04 05:44:50', 3, 0, 0, 7),
(12, 879091109123433100, 'Bước sang hiệp 2 Juve tiếp tục phải đẩy cao đội hình chấp nhận mạo hiểm. Và rồi quyết định này đã khiến đội chủ nhà trả giá đắt. Real Madrid thi đấu quá lạnh lùng và bản lĩnh. Phút 63, Ronaldo tận dụng sai lầm của hàng thủ, chuyền bóng cho Lucas Vazquez dứt điểm. Buffon đã bay người cứu thua xuất sắc nhưng tình huống sau đó anh chỉ biết đứng nhìn khi CR7 tung móc đưa bóng vào cột xa nhân đôi cách biệt.', NULL, NULL, '2018-04-04 06:20:26', 3, 0, 0, 7),
(15, 684711463953969800, 'A list of famous people, chosen mainly from the nineteenth, twentieth or twenty-first centuries. This list includes famous actors, politicians, entrepreneurs, writers, artists and humanitarians.\n\nMarilyn Monroe (1926 – 1962) American actress, singer, model\nAbraham Lincoln (1809 – 1865) US President during American civil war\nMother Teresa (1910 – 1997) Macedonian Catholic missionary nun\nJohn F. Kennedy (1917 – 1963) US President 1961 – 1963\nMartin Luther King (1929 – 1968)  American civil rights campaigner\nNelson Mandela (1918 – 2013)  South African President anti-apartheid campaigner\nQueen Elizabeth II (1926 – ) British monarch since 1954\nWinston Churchill (1874 – 1965) British Prime Minister during WWII\nDonald Trump (1946 – ) Businessman, politician\nBill Gates (1955 – ) American businessman, founder of Microsoft\nMuhammad Ali (1942 – 2016) American Boxer and civil rights campaigner\nMahatma Gandhi (1869 – 1948) Leader of Indian independence movement\nMargaret Thatcher (1925 – 2013) British Prime Minister 1979 – 1990 1', NULL, NULL, '2018-04-04 12:19:55', 3, 0, 1, 7),
(16, 804260829616815200, 'Hello world. eeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeee', NULL, NULL, '2018-04-05 17:14:30', 2, 0, NULL, 7),
(17, 737277912960938800, 'nobody ???ffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffssssssssssssssssssssssssssssssssssssss', NULL, NULL, '2018-04-06 23:30:57', 5, 0, NULL, 5),
