(19, 879091109123433100, 'xin chao cac ban toi ten là phmaj van linh, nay toi co mot cau hoi la tai sao ngu phap viet nam lai rac roi va phuc tap nhu vay, vi du như từ chết sao lại có nhiều nghĩa là tử, ngỏm, hi sinh ????', NULL, NULL, '2018-04-07 12:21:54', 1, 0, NULL, 7),
(20, 804260829616815200, 'ddddddddddddddddddddddddddddddddddddddddddddddđccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccc hehe\n', NULL, NULL, '2018-04-07 15:15:06', 5, 0, 1, 7),
(22, 804260829616815200, 'The antecedent is the noun that the pronoun replaces. Within sentences, the pronoun must agree with the antecedent in number (singular/plural). Wrong: Each person must take their coat to the dry cleaner. The pronoun in this sentence is their, and the antecedent is person hello\n', NULL, NULL, '2018-04-22 03:35:41', 5, 0, 1, 7),
